import { queryPokemons } from '../../hooks/query'

export default () => {
  queryPokemons().actions.getPaginated()
  const { data } = queryPokemons()

  return (
    <div>
      <h1>HOME</h1>
      {data.paginated.paginatedData?.results.map((item) => item.name)}
    </div>
  )
}
